script: |
  super -f text -I q12254.spq | sort > q12254.out

inputs:
  - name: q12254.spq
    data: |
      SELECT ALL 70 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT + col1 IN ( - 55 / col0, + ( - 8 ) - col0 * - col2 );
  - name: tab0

outputs:
  - name: q12254.out
    data: |
      70
      70
      70
